import React, { useEffect } from "react";
import { Link, NavLink } from "react-router-dom";
import axios from "axios";

const Login = () => {
  // const navigate = NavLink();
  useEffect(() => {
    const getUserInfo = async () => {
      try {
        const { data } = await axios.get(
          "http://localhost:5000/api/user/login",
          {
            phone: "9509705632",
            otp: "810515",
          }
        );
        console.log(data);
      } catch (error) {
        console.log(error.message);
      }
    };
    getUserInfo();
  }, []);
  return (
    <div class="otp_wraper">
      <div class="otp_form">
        <div class="logo_otp text-center">
          <a target="_blank" href="#">
            <img
              width="170"
              src="images/inbound-academy-logo.webp"
              alt="Logo"
            />
          </a>
        </div>
        <div class="otp_content text-center">
          <h3>Verify Mobile</h3>
          <p>Enter the OTP (One Time Password) Sent to +91 91525852585</p>
          <input type="text" placeholder="Enter OTP here" required />

          {/* <input type="submit" value="Verify OTP" /> */}
          <button className="btn" type="submit">
            VERIFY OTP
          </button>
        </div>
        <div class="otp_resend text-center">
          <p>Check your Email for the OTP</p>
          <a href="#">Resend</a>
        </div>
      </div>
    </div>
  );
};

export default Login;
